import React from 'react';

const BudgetInput = () => {
	return (
		<div class="ui form">
		  <div class="fields">
		    <div class="field">
		      <label>Description</label>
		      <input type="text" placeholder="Description"/>
		    </div>
		    <div class="field">
		      <label>Amount</label>
		      <input type="text" placeholder="$$"/>
		    </div>
		    <div class="field">
		      <label>Last name</label>
		      <input type="text" placeholder="Last Name"/>
		    </div>
		  </div>
		</div>
	);
}

export default BudgetInput;
